import React from "react";
import { Card } from "../component/Card";

export default function Cards({
  singleCard,
  data,
  handleDetail,
  openDetails,
  closeDetail,
}) {
  return (
    <div
      onClick={openDetails ? { closeDetail } : null}
      className="flex flex-wrap flex justify-between h-[85%] "
    >
      {data.map((animal) => (
        <Card
          singleCard={singleCard}
          handleDetail={handleDetail}
          key={animal.id}
          animal={animal}
        />
      ))}
    </div>
  );
}
